import React from 'react';
import { Grid, Card, CardContent } from '@material-ui/core'

import Player from './Player';

const avOne = 'https://api.adorable.io/avatars/60/one@adorable.io.png';
const avTwo = 'https://api.adorable.io/avatars/60/two@adorable.io.png';
const avThree = 'https://api.adorable.io/avatars/60/three@adorable.io.png';
const avFour = 'https://api.adorable.io/avatars/60/four@adorable.io.png';
const avFive = 'https://api.adorable.io/avatars/60/five@adorable.io.png';


const Players = () => (
  <Grid item md={12} lg={5} xl={3}>
    <Card className="card--not-full-height">
      <CardContent>
        <div className="card__title">
          <h5 className="bold-text">Players</h5>
        </div>
        <Player img={avOne} name="one" />
        <Player img={avTwo} name="two" />
        <Player img={avThree} name="three" />
        <Player img={avFour} name="four" />
        <Player img={avFive} name="five" />
      </CardContent>
    </Card>
  </Grid>
);

export default Players;
